import React,{Component} from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
      super(props);
      this.state = 
      { 
        count_0: 0,count_1: 0,count_2: 0,count_3: 0,
       };
  }

  incrementCount = () => {
  this.setState(
          { count_0: this.state.count + 1,
            count_1: this.state.count + 1,
            count_2: this.state.count + 1,
            count_3: this.state.count + 1,
          }
      );
};

  render() {
      return (
        <div className="languages">
          <h1>Vote Your Language!</h1>
          <div className="language_php">
            <div className="languageCount"></div>
            <div className="languageName"></div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count_0 }
            </div>
          </div>
          <div className="language_python">
            <div className="languageCount"></div>
            <div className="languageName"></div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count_1 }
            </div>
          </div>
          <div className="language_go">
            <div className="languageCount"></div>
            <div className="languageName"></div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count_2 }
            </div>
          </div>
          <div className="language_java">
            <div className="languageCount"></div>
            <div className="languageName"></div>
            <div className="click" onClick={ this.incrementCount }>
              Clicks: { this.state.count_3 }
            </div>
          </div>
        </div>

      );
  }
}

export default App;
